import PropTypes from 'prop-types';

export default function Contact({ name, number }) {
  return (
    <li>
      <span>
        {name}:{number}
      </span>
    </li>
  );
}

Contact.propTypes = {
  name: PropTypes.string.isRequired,
  number: PropTypes.string.isRequired,
};
